oxy_webhelp_navlinks = {"con_access.dita-d4802e3377":{"topics":[{"title":"How do I give someone access to manage my contacts?","shortdesc":"<p class=\"shortdesc\">You can let specified people open your mail, calendar, to do, or contact entries. You can also let people send, edit (including adding a follow-up flag), and delete messages, create and delete calendar entries, and create and delete to do items for you.<\/p>","href":"con_access_t.html","attributes":{"data-id":"con_access_t"},"menu":{"hasChildren":false},"tocID":"con_access_t-d4802e3388","topics":[]},{"title":"How do I open someone else's Contacts?","shortdesc":"<p class=\"shortdesc\">Depending on how much access you have to the Contacts file, you can read or edit someone else's Contact entries.<\/p>","href":"con_open_others_t.html","attributes":{"data-id":"con_open_others_contacts_t"},"menu":{"hasChildren":false},"tocID":"con_open_others_contacts_t-d4802e3399","topics":[]},{"title":"How do I create a shortcut to another person's Contacts?","shortdesc":"<p class=\"shortdesc\">You can create shortcuts to someone's NotesÂ® mail, calendar, to do, or contacts, if that person has given you access.<\/p>","href":"con_shortcut_t.html","attributes":{"data-id":"con_shortcut_t"},"menu":{"hasChildren":false},"tocID":"con_shortcut_t-d4802e3410","topics":[]}]}};